import{_ as e,c as l,o as r,ae as a}from"./chunks/framework.CIivgcbp.js";const y=JSON.parse('{"title":"DOM 事件一览","description":"","frontmatter":{},"headers":[],"relativePath":"前端技术/03 JavaScript/06浏览器环境/DOM/DOM事件一览.md","filePath":"前端技术/03 JavaScript/06浏览器环境/DOM/DOM事件一览.md"}'),n={name:"前端技术/03 JavaScript/06浏览器环境/DOM/DOM事件一览.md"};function d(s,t,f,o,h,i){return r(),l("div",null,t[0]||(t[0]=[a('<h1 id="dom-事件一览" tabindex="-1">DOM 事件一览 <a class="header-anchor" href="#dom-事件一览" aria-label="Permalink to &quot;DOM 事件一览&quot;">​</a></h1><h2 id="一、事件方法汇总" tabindex="-1">一、事件方法汇总 <a class="header-anchor" href="#一、事件方法汇总" aria-label="Permalink to &quot;一、事件方法汇总&quot;">​</a></h2><p>*DOM：表格中指明使用的 DOM 属性级别。</p><h3 id="鼠标事件" tabindex="-1">鼠标事件 <a class="header-anchor" href="#鼠标事件" aria-label="Permalink to &quot;鼠标事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onclick.html" target="_blank" rel="noreferrer">onclick</a></td><td style="text-align:left;">当用户点击某个对象时调用的事件句柄。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-oncontextmenu.html" target="_blank" rel="noreferrer">oncontextmenu</a></td><td style="text-align:left;">在用户点击鼠标右键打开上下文菜单时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-ondblclick.html" target="_blank" rel="noreferrer">ondblclick</a></td><td style="text-align:left;">当用户双击某个对象时调用的事件句柄。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onmousedown.html" target="_blank" rel="noreferrer">onmousedown</a></td><td style="text-align:left;">鼠标按钮被按下。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onmouseenter.html" target="_blank" rel="noreferrer">onmouseenter</a></td><td style="text-align:left;">当鼠标指针移动到元素上时触发。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onmouseleave.html" target="_blank" rel="noreferrer">onmouseleave</a></td><td style="text-align:left;">当鼠标指针移出元素时触发</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onmousemove.html" target="_blank" rel="noreferrer">onmousemove</a></td><td style="text-align:left;">鼠标被移动。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onmouseover.html" target="_blank" rel="noreferrer">onmouseover</a></td><td style="text-align:left;">鼠标移到某元素之上。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onmouseout.html" target="_blank" rel="noreferrer">onmouseout</a></td><td style="text-align:left;">鼠标从某元素移开。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onmouseup.html" target="_blank" rel="noreferrer">onmouseup</a></td><td style="text-align:left;">鼠标按键被松开。</td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="键盘事件" tabindex="-1">键盘事件 <a class="header-anchor" href="#键盘事件" aria-label="Permalink to &quot;键盘事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onkeydown.html" target="_blank" rel="noreferrer">onkeydown</a></td><td style="text-align:left;">某个键盘按键被按下。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onkeypress.html" target="_blank" rel="noreferrer">onkeypress</a></td><td style="text-align:left;">某个键盘按键被按下并松开。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onkeyup.html" target="_blank" rel="noreferrer">onkeyup</a></td><td style="text-align:left;">某个键盘按键被松开。</td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="框架-对象-frame-object-事件" tabindex="-1">框架/对象（Frame/Object）事件 <a class="header-anchor" href="#框架-对象-frame-object-事件" aria-label="Permalink to &quot;框架/对象（Frame/Object）事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onabort.html" target="_blank" rel="noreferrer">onabort</a></td><td style="text-align:left;">图像的加载被中断。 ( &lt;object&gt;)</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onbeforeunload.html" target="_blank" rel="noreferrer">onbeforeunload</a></td><td style="text-align:left;">该事件在即将离开页面（刷新或关闭）时触发</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onerror.html" target="_blank" rel="noreferrer">onerror</a></td><td style="text-align:left;">在加载文档或图像时发生错误。 ( &lt;object&gt;,&lt;body&gt;和 &lt;frameset&gt;)</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onhashchange.html" target="_blank" rel="noreferrer">onhashchange</a></td><td style="text-align:left;">该事件在当前 URL 的锚部分发生修改时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onload.html" target="_blank" rel="noreferrer">onload</a></td><td style="text-align:left;">一张页面或一幅图像完成加载。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onpageshow.html" target="_blank" rel="noreferrer">onpageshow</a></td><td style="text-align:left;">该事件在用户访问页面时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onpagehide.html" target="_blank" rel="noreferrer">onpagehide</a></td><td style="text-align:left;">该事件在用户离开当前网页跳转到另外一个页面时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onresize.html" target="_blank" rel="noreferrer">onresize</a></td><td style="text-align:left;">窗口或框架被重新调整大小。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onscroll.html" target="_blank" rel="noreferrer">onscroll</a></td><td style="text-align:left;">当文档被滚动时发生的事件。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onunload.html" target="_blank" rel="noreferrer">onunload</a></td><td style="text-align:left;">用户退出页面。 (&lt;body&gt; 和 &lt;frameset&gt;)</td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="表单事件" tabindex="-1">表单事件 <a class="header-anchor" href="#表单事件" aria-label="Permalink to &quot;表单事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onblur.html" target="_blank" rel="noreferrer">onblur</a></td><td style="text-align:left;">元素失去焦点时触发</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onchange.html" target="_blank" rel="noreferrer">onchange</a></td><td style="text-align:left;">该事件在表单元素的内容改变时触发 ( &lt;input&gt;, &lt;keygen&gt;, &lt;select&gt;, 和 &lt;textarea&gt;)</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onfocus.html" target="_blank" rel="noreferrer">onfocus</a></td><td style="text-align:left;">元素获取焦点时触发</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onfocusin.html" target="_blank" rel="noreferrer">onfocusin</a></td><td style="text-align:left;">元素即将获取焦点时触发</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-onfocusout.html" target="_blank" rel="noreferrer">onfocusout</a></td><td style="text-align:left;">元素即将失去焦点时触发</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-oninput.html" target="_blank" rel="noreferrer">oninput</a></td><td style="text-align:left;">元素获取用户输入时触发</td><td style="text-align:left;">3</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onreset.html" target="_blank" rel="noreferrer">onreset</a></td><td style="text-align:left;">表单重置时触发</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onsearch.html" target="_blank" rel="noreferrer">onsearch</a></td><td style="text-align:left;">用户向搜索域输入文本时触发 (&lt;input=&quot;search&quot;&gt;)</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onselect.html" target="_blank" rel="noreferrer">onselect</a></td><td style="text-align:left;">用户选取文本时触发 ( &lt;input&gt; 和 &lt;textarea&gt;)</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onsubmit.html" target="_blank" rel="noreferrer">onsubmit</a></td><td style="text-align:left;">表单提交时触发</td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="剪贴板事件" tabindex="-1">剪贴板事件 <a class="header-anchor" href="#剪贴板事件" aria-label="Permalink to &quot;剪贴板事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-oncopy.html" target="_blank" rel="noreferrer">oncopy</a></td><td style="text-align:left;">该事件在用户拷贝元素内容时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/jsref-event-oncut.html" target="_blank" rel="noreferrer">oncut</a></td><td style="text-align:left;">该事件在用户剪切元素内容时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onpaste.html" target="_blank" rel="noreferrer">onpaste</a></td><td style="text-align:left;">该事件在用户粘贴元素内容时触发</td><td style="text-align:left;"></td></tr></tbody></table><h3 id="打印事件" tabindex="-1">打印事件 <a class="header-anchor" href="#打印事件" aria-label="Permalink to &quot;打印事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onafterprint.html" target="_blank" rel="noreferrer">onafterprint</a></td><td style="text-align:left;">该事件在页面已经开始打印，或者打印窗口已经关闭时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onbeforeprint.html" target="_blank" rel="noreferrer">onbeforeprint</a></td><td style="text-align:left;">该事件在页面即将开始打印时触发</td><td style="text-align:left;"></td></tr></tbody></table><h3 id="拖动事件" tabindex="-1">拖动事件 <a class="header-anchor" href="#拖动事件" aria-label="Permalink to &quot;拖动事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">事件</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondrag.html" target="_blank" rel="noreferrer">ondrag</a></td><td style="text-align:left;">该事件在元素正在拖动时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondragend.html" target="_blank" rel="noreferrer">ondragend</a></td><td style="text-align:left;">该事件在用户完成元素的拖动时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondragenter.html" target="_blank" rel="noreferrer">ondragenter</a></td><td style="text-align:left;">该事件在拖动的元素进入放置目标时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondragleave.html" target="_blank" rel="noreferrer">ondragleave</a></td><td style="text-align:left;">该事件在拖动元素离开放置目标时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondragover.html" target="_blank" rel="noreferrer">ondragover</a></td><td style="text-align:left;">该事件在拖动元素在放置目标上时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondragstart.html" target="_blank" rel="noreferrer">ondragstart</a></td><td style="text-align:left;">该事件在用户开始拖动元素时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondrop.html" target="_blank" rel="noreferrer">ondrop</a></td><td style="text-align:left;">该事件在拖动元素放置在目标区域时触发</td><td style="text-align:left;"></td></tr></tbody></table><h3 id="多媒体-media-事件" tabindex="-1">多媒体（Media）事件 <a class="header-anchor" href="#多媒体-media-事件" aria-label="Permalink to &quot;多媒体（Media）事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">事件</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onabort-media.html" target="_blank" rel="noreferrer">onabort</a></td><td style="text-align:left;">事件在视频/音频（audio/video）终止加载时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-oncanplay.html" target="_blank" rel="noreferrer">oncanplay</a></td><td style="text-align:left;">事件在用户可以开始播放视频/音频（audio/video）时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-oncanplaythrough.html" target="_blank" rel="noreferrer">oncanplaythrough</a></td><td style="text-align:left;">事件在视频/音频（audio/video）可以正常播放且无需停顿和缓冲时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ondurationchange.html" target="_blank" rel="noreferrer">ondurationchange</a></td><td style="text-align:left;">事件在视频/音频（audio/video）的时长发生变化时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onemptied</td><td style="text-align:left;">当期播放列表为空时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onended.html" target="_blank" rel="noreferrer">onended</a></td><td style="text-align:left;">事件在视频/音频（audio/video）播放结束时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onerror-media.html" target="_blank" rel="noreferrer">onerror</a></td><td style="text-align:left;">事件在视频/音频（audio/video）数据加载期间发生错误时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onloadeddata.html" target="_blank" rel="noreferrer">onloadeddata</a></td><td style="text-align:left;">事件在浏览器加载视频/音频（audio/video）当前帧时触发触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onloadedmetadata.html" target="_blank" rel="noreferrer">onloadedmetadata</a></td><td style="text-align:left;">事件在指定视频/音频（audio/video）的元数据加载后触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onloadstart.html" target="_blank" rel="noreferrer">onloadstart</a></td><td style="text-align:left;">事件在浏览器开始寻找指定视频/音频（audio/video）触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onpause.html" target="_blank" rel="noreferrer">onpause</a></td><td style="text-align:left;">事件在视频/音频（audio/video）暂停时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onplay.html" target="_blank" rel="noreferrer">onplay</a></td><td style="text-align:left;">事件在视频/音频（audio/video）开始播放时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onplaying.html" target="_blank" rel="noreferrer">onplaying</a></td><td style="text-align:left;">事件在视频/音频（audio/video）暂停或者在缓冲后准备重新开始播放时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onprogress.html" target="_blank" rel="noreferrer">onprogress</a></td><td style="text-align:left;">事件在浏览器下载指定的视频/音频（audio/video）时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onratechange.html" target="_blank" rel="noreferrer">onratechange</a></td><td style="text-align:left;">事件在视频/音频（audio/video）的播放速度发送改变时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onseeked.html" target="_blank" rel="noreferrer">onseeked</a></td><td style="text-align:left;">事件在用户重新定位视频/音频（audio/video）的播放位置后触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onseeking.html" target="_blank" rel="noreferrer">onseeking</a></td><td style="text-align:left;">事件在用户开始重新定位视频/音频（audio/video）时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onstalled.html" target="_blank" rel="noreferrer">onstalled</a></td><td style="text-align:left;">事件在浏览器获取媒体数据，但媒体数据不可用时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onsuspend.html" target="_blank" rel="noreferrer">onsuspend</a></td><td style="text-align:left;">事件在浏览器读取媒体数据中止时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ontimeupdate.html" target="_blank" rel="noreferrer">ontimeupdate</a></td><td style="text-align:left;">事件在当前的播放位置发送改变时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onvolumechange.html" target="_blank" rel="noreferrer">onvolumechange</a></td><td style="text-align:left;">事件在音量发生改变时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onwaiting.html" target="_blank" rel="noreferrer">onwaiting</a></td><td style="text-align:left;">事件在视频由于要播放下一帧而需要缓冲时触发。</td><td style="text-align:left;"></td></tr></tbody></table><h3 id="动画事件" tabindex="-1">动画事件 <a class="header-anchor" href="#动画事件" aria-label="Permalink to &quot;动画事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">事件</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-animationend.html" target="_blank" rel="noreferrer">animationend</a></td><td style="text-align:left;">该事件在 CSS 动画结束播放时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-animationiteration.html" target="_blank" rel="noreferrer">animationiteration</a></td><td style="text-align:left;">该事件在 CSS 动画重复播放时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-animationstart.html" target="_blank" rel="noreferrer">animationstart</a></td><td style="text-align:left;">该事件在 CSS 动画开始播放时触发</td><td style="text-align:left;"></td></tr></tbody></table><h3 id="过渡事件" tabindex="-1">过渡事件 <a class="header-anchor" href="#过渡事件" aria-label="Permalink to &quot;过渡事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">事件</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-transitionend.html" target="_blank" rel="noreferrer">transitionend</a></td><td style="text-align:left;">该事件在 CSS 完成过渡后触发。</td><td style="text-align:left;"></td></tr></tbody></table><h3 id="其他事件" tabindex="-1">其他事件 <a class="header-anchor" href="#其他事件" aria-label="Permalink to &quot;其他事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">事件</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;">onmessage</td><td style="text-align:left;">该事件通过或者从对象 (WebSocket, Web Worker, Event Source 或者子 frame 或父窗口) 接收到消息时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onmousewheel</td><td style="text-align:left;">已废弃。 使用 <a href="https://www.w3cschool.cn/jsref/event-onwheel.html" target="_blank" rel="noreferrer">onwheel</a> 事件替代</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ononline.html" target="_blank" rel="noreferrer">ononline</a></td><td style="text-align:left;">该事件在浏览器开始在线工作时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onoffline.html" target="_blank" rel="noreferrer">onoffline</a></td><td style="text-align:left;">该事件在浏览器开始离线工作时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onpopstate</td><td style="text-align:left;">该事件在窗口的浏览历史（history 对象）发生改变时触发。</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onshow.html" target="_blank" rel="noreferrer">onshow</a></td><td style="text-align:left;">该事件当 &lt;menu&gt; 元素在上下文菜单显示时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;">onstorage</td><td style="text-align:left;">该事件在 Web Storage(HTML 5 Web 存储) 更新时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ontoggle.html" target="_blank" rel="noreferrer">ontoggle</a></td><td style="text-align:left;">该事件在用户打开或关闭 &lt;details&gt; 元素时触发</td><td style="text-align:left;"></td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-onwheel.html" target="_blank" rel="noreferrer">onwheel</a></td><td style="text-align:left;">该事件在鼠标滚轮在元素上下滚动时触发</td><td style="text-align:left;"></td></tr></tbody></table><h2 id="二、事件对象" tabindex="-1">二、事件对象 <a class="header-anchor" href="#二、事件对象" aria-label="Permalink to &quot;二、事件对象&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:left;">静态变量</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;">CAPTURING-PHASE</td><td style="text-align:left;">当前事件阶段为捕获阶段 (3)</td><td style="text-align:left;">1</td></tr><tr><td style="text-align:left;">AT-TARGET</td><td style="text-align:left;">当前事件是目标阶段,在评估目标事件 (1)</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;">BUBBLING-PHASE</td><td style="text-align:left;">当前的事件为冒泡阶段 (2)</td><td style="text-align:left;">3</td></tr></tbody></table><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-bubbles.html" target="_blank" rel="noreferrer">bubbles</a></td><td style="text-align:left;">返回布尔值，指示事件是否是起泡事件类型。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-cancelable.html" target="_blank" rel="noreferrer">cancelable</a></td><td style="text-align:left;">返回布尔值，指示事件是否可拥可取消的默认动作。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-currenttarget.html" target="_blank" rel="noreferrer">currentTarget</a></td><td style="text-align:left;">返回其事件监听器触发该事件的元素。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;">eventPhase</td><td style="text-align:left;">返回事件传播的当前阶段。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-target.html" target="_blank" rel="noreferrer">target</a></td><td style="text-align:left;">返回触发此事件的元素（事件的目标节点）。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-timestamp.html" target="_blank" rel="noreferrer">timeStamp</a></td><td style="text-align:left;">返回事件生成的日期和时间。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-type.html" target="_blank" rel="noreferrer">type</a></td><td style="text-align:left;">返回当前 Event 对象表示的事件的名称。</td><td style="text-align:left;">2</td></tr></tbody></table><table tabindex="0"><thead><tr><th style="text-align:left;">方法</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;">initEvent()</td><td style="text-align:left;">初始化新创建的 Event 对象的属性。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;">preventDefault()</td><td style="text-align:left;">通知浏览器不要执行与事件关联的默认动作。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;">stopPropagation()</td><td style="text-align:left;">不再派发事件。</td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="目标事件对象" tabindex="-1">目标事件对象 <a class="header-anchor" href="#目标事件对象" aria-label="Permalink to &quot;目标事件对象&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">方法</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;">addEventListener()</td><td style="text-align:left;">允许在目标事件中注册监听事件 (IE8= attachEvent())</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;">dispatchEvent()</td><td style="text-align:left;">允许发送事件到监听器上 (IE8 =fireEvent())</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;">removeEventListener()</td><td style="text-align:left;">运行一次注册在事件目标上的监听事件 (IE8 =detachEvent())</td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="事件监听对象" tabindex="-1">事件监听对象 <a class="header-anchor" href="#事件监听对象" aria-label="Permalink to &quot;事件监听对象&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">方法</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;">handleEvent()</td><td style="text-align:left;">把任意对象注册为事件处理程序</td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="文档事件对象" tabindex="-1">文档事件对象 <a class="header-anchor" href="#文档事件对象" aria-label="Permalink to &quot;文档事件对象&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">方法</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;">createEvent()</td><td style="text-align:left;"></td><td style="text-align:left;">2</td></tr></tbody></table><h3 id="鼠标-键盘事件对象" tabindex="-1">鼠标/键盘事件对象 <a class="header-anchor" href="#鼠标-键盘事件对象" aria-label="Permalink to &quot;鼠标/键盘事件对象&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">属性</th><th style="text-align:left;">描述</th><th style="text-align:left;">DOM</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-altkey.html" target="_blank" rel="noreferrer">altKey</a></td><td style="text-align:left;">返回当事件被触发时，&quot;ALT&quot; 是否被按下。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-button.html" target="_blank" rel="noreferrer">button</a></td><td style="text-align:left;">返回当事件被触发时，哪个鼠标按钮被点击。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-clientx.html" target="_blank" rel="noreferrer">clientX</a></td><td style="text-align:left;">返回当事件被触发时，鼠标指针的水平坐标。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-clienty.html" target="_blank" rel="noreferrer">clientY</a></td><td style="text-align:left;">返回当事件被触发时，鼠标指针的垂直坐标。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-ctrlkey.html" target="_blank" rel="noreferrer">ctrlKey</a></td><td style="text-align:left;">返回当事件被触发时，&quot;CTRL&quot; 键是否被按下。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-key-location.html" target="_blank" rel="noreferrer">Location</a></td><td style="text-align:left;">返回按键在设备上的位置</td><td style="text-align:left;">3</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-key-charcode.html" target="_blank" rel="noreferrer">charCode</a></td><td style="text-align:left;">返回 onkeypress 事件触发键值的字母代码。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-key-key.html" target="_blank" rel="noreferrer">key</a></td><td style="text-align:left;">在按下按键时返回按键的标识符。</td><td style="text-align:left;">3</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-key-keycode.html" target="_blank" rel="noreferrer">keyCode</a></td><td style="text-align:left;">返回 onkeypress 事件触发的键的值的字符代码，或者 onkeydown 或 onkeyup 事件的键的代码。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-key-which.html" target="_blank" rel="noreferrer">which</a></td><td style="text-align:left;">返回 onkeypress 事件触发的键的值的字符代码，或者 onkeydown 或 onkeyup 事件的键的代码。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-metakey.html" target="_blank" rel="noreferrer">metaKey</a></td><td style="text-align:left;">返回当事件被触发时，&quot;meta&quot; 键是否被按下。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-relatedtarget.html" target="_blank" rel="noreferrer">relatedTarget</a></td><td style="text-align:left;">返回与事件的目标节点相关的节点。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-screenx.html" target="_blank" rel="noreferrer">screenX</a></td><td style="text-align:left;">返回当某个事件被触发时，鼠标指针的水平坐标。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-screeny.html" target="_blank" rel="noreferrer">screenY</a></td><td style="text-align:left;">返回当某个事件被触发时，鼠标指针的垂直坐标。</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;"><a href="https://www.w3cschool.cn/jsref/event-shiftkey.html" target="_blank" rel="noreferrer">shiftKey</a></td><td style="text-align:left;">返回当事件被触发时，&quot;SHIFT&quot; 键是否被按下。</td><td style="text-align:left;">2</td></tr></tbody></table><table tabindex="0"><thead><tr><th style="text-align:left;">方法</th><th style="text-align:left;">描述</th><th style="text-align:left;">W3C</th></tr></thead><tbody><tr><td style="text-align:left;">initMouseEvent()</td><td style="text-align:left;">初始化鼠标事件对象的值</td><td style="text-align:left;">2</td></tr><tr><td style="text-align:left;">initKeyboardEvent()</td><td style="text-align:left;">初始化键盘事件对象的值</td><td style="text-align:left;">3</td></tr></tbody></table>',38)]))}const x=e(n,[["render",d]]);export{y as __pageData,x as default};
